	#login
client = amino.Client()
async def login():
	while True:
		try:
			email = input("Email >> ")
			password = stdiomask.getpass("Password >> ")
			await client.login(email=email, password=password)
			return False
		except amino.lib.util.exceptions.ActionNotAllowed:
			print("Action Not Allowed")
		except amino.lib.util.exceptions.InvalidPassword:
			print("Invalid Password")
		except amino.lib.util.exceptions.InvalidEmail:
			print("Invalid Email")
		except amino.lib.util.exceptions.FailedLogin:
			print("Failed Login")
		except amino.lib.util.exceptions.VerificationRequired as e:
			print(f"Verification required for {email}")
			link = e.args[0]['url']
			print(link)
			input("Waiting For Verification >> ")
		except:
			return

async def communities():
	try:
		clients = await client.sub_clients(size=100)
		for x, name in enumerate(clients.name, 1):
			print(f"{x}.{name}")
		while True:
			communityid = clients.comId[int(input("Select the community >> "))-1]
			return communityid
	except ValueError:
		print("ValueError")
		await communities()
	except amino.lib.util.exceptions.NotLoggedIn:
		print("NotLoggedIn")
		return
	except:
		return

