async def sysmessagespam():
	await login()
	sub_client = await amino.SubClient(comId=await communities(), profile=client.profile)
	message = input("Message >> ")
	msgtype = input("MessageType >> ")
	chatx = await chats()
	while True:
		print("Spamming...")
		await asyncio.gather(*[asyncio.create_task(sub_client.send_message(chatx, msg, msgtype)) for _ in range(100)])

async def sysmessagesend():
	await login()
	sub_client = await amino.SubClient(comId=await communities(), profile=client.profile)
	chatx = await chats()
	while True:
		try:
			sysmsg = input("Message >> ")
			for i in range(1):
				await sub_client.send_message(chatId=chatx, messageType=107, message=sysmsg)
		except:
			pass

async def joinleavespam():
	await login()
	sub_client = await amino.SubClient(comId=await communities(), profile=client.profile)
	chatx = await chats()
	while True:
		sub_client.leave_chat(chatId=chatx)
		sub_client.join_chat(chatId=chatx)

async def iprecipient():
	await login()
	sub_client = await amino.SubClient(comId=await communities(), profile=client.profile)
	wallet = await sub_client.get_wallet_history(size=50)
